import React from 'react';
import './textbox.css'; // Import CSS file for styling

const TextareaPage = () => {
  return (
    <div className="chatgpt-textarea-container">
      <div className="chatgpt-textarea">
        <label htmlFor="chatgpt-textarea">Your Message</label>
        <textarea
          className="chatgpt-textarea-input"
          id="chatgpt-textarea"
          rows="5"
          placeholder="Type your message here..."
        />
      </div>
    </div>
  );
};

export default TextareaPage;
